// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.8.20 <0.9.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract MetaCoin is ERC20, Ownable {
    string public constant NAME = "syfERC20Token";
    string public constant SYMBOL = "syf";
    uint256 public constant INITIAL_SUPPLY = 10000;

    // 设置价格：1 ETH = 1000 syf 代币
    uint256 public tokenPrice = 0.001 ether; // 1 syf = 0.001 ETH

    event TokensPurchased(
        address buyer,
        uint256 ethAmount,
        uint256 tokenAmount
    );
    event TokensSold(address seller, uint256 tokenAmount, uint256 ethAmount);
    event TokensWithdrawn(address to, uint256 amount);

    constructor() ERC20(NAME, SYMBOL) {
        _mint(msg.sender, INITIAL_SUPPLY);
    }

    function decimals() public view virtual override returns (uint8) {
        return 0;
    }

    // 购买代币功能
    function buyTokens() external payable {
        require(msg.value > 0, "ETH amount must be greater than 0");

        uint256 tokenAmount = msg.value / tokenPrice;
        require(tokenAmount > 0, "Token amount must be greater than 0");
        require(
            balanceOf(owner()) >= tokenAmount,
            "Not enough tokens available"
        );

        // 从合约拥有者转账代币给购买者
        _transfer(owner(), msg.sender, tokenAmount);

        emit TokensPurchased(msg.sender, msg.value, tokenAmount);
    }

    // 出售代币功能
    function sellTokens(uint256 tokenAmount) external {
        require(tokenAmount > 0, "Token amount must be greater than 0");
        require(balanceOf(msg.sender) >= tokenAmount, "Not enough tokens");

        uint256 ethAmount = tokenAmount * tokenPrice;
        require(
            address(this).balance >= ethAmount,
            "Not enough ETH in contract"
        );

        // 从卖家转账代币到合约拥有者
        _transfer(msg.sender, owner(), tokenAmount);

        // 发送 ETH 给卖家
        payable(msg.sender).transfer(ethAmount);

        emit TokensSold(msg.sender, tokenAmount, ethAmount);
    }

    // 设置代币价格（只有拥有者可以调用）
    function setTokenPrice(uint256 _tokenPrice) external onlyOwner {
        tokenPrice = _tokenPrice;
    }

    // 向合约存入 ETH（用于购买代币时的储备）
    function depositETH() external payable onlyOwner {
        // ETH 自动添加到合约余额
    }

    // 提取合约中的 ETH
    function withdrawETH(uint256 amount) external onlyOwner {
        require(address(this).balance >= amount, "Not enough ETH in contract");
        payable(owner()).transfer(amount);
    }

    // 提取合约中的代币（只有所有者可以调用）
    function withdrawTokens(address to, uint256 amount) external onlyOwner {
        require(to != address(0), "Cannot withdraw to zero address");
        require(
            balanceOf(address(this)) >= amount,
            "Not enough tokens in contract"
        );

        _transfer(address(this), to, amount);

        emit TokensWithdrawn(to, amount);
    }

    // 提取合约中的所有代币
    function withdrawAllTokens(address to) external onlyOwner {
        uint256 contractBalance = balanceOf(address(this));
        require(contractBalance > 0, "No tokens to withdraw");

        _transfer(address(this), to, contractBalance);

        emit TokensWithdrawn(to, contractBalance);
    }

    // 查看合约 ETH 余额
    function getContractETHBalance() external view returns (uint256) {
        return address(this).balance;
    }

    // 计算购买代币需要的 ETH
    function calculateETHForTokens(
        uint256 tokenAmount
    ) external view returns (uint256) {
        return tokenAmount * tokenPrice;
    }

    // 计算用 ETH 能买到的代币数量
    function calculateTokensForETH(
        uint256 ethAmount
    ) external view returns (uint256) {
        return ethAmount / tokenPrice;
    }
}
